INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (1, 135, 'Self motivation is necessary for self leadership and is a great tool for productivity. Motivation is created from fulfilling the human practical needs.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (2, 136, 'Train your team leaders about how to lift up peoples motivation. Arrange workshops for all employees.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (4, 138, 'It is normally better to increase strenghts first and only after that reduce weaknesses. You get to know about people´s strenghts by mapping their abilities and traits.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (5, 139, 'Conduct a strenghts survey of all your employees and arrange practical workshops accordingly. Train your team leaders to find individual key strenghts.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (6, 141, 'Emotional mastery is about mastering focus. How we focus determines our energy level and thereby very much about our productivity.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (7, 142, 'Start using the Focus tool on all levels in your company.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (21, 155, 'All companies consists of teams in different sizes. Mutual trust is a crucial element in establishing alignment. Trust is also fundamental for receiving constructive feedback.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (22, 156, 'Train all leaders in trust building according to the trust pyramid.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (24, 158, 'Roles in a team is a key factor for high team and individual performance. Roles have two dimensions: individual role for team member and secondly the role of the team itself. When roles are clear, responsibilities can be trained and  the synergies will show up.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (25, 159, 'Train your teams to engage in the company´s vision and strategy. Discuss with your team leaders about how to find more synergies between different teams and departments.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (27, 161, 'When people feel accountable, they focus on productive behavior according to customer needs. When expectations are clear it is easier to achieve results-oriented outcomes.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (28, 162, 'Agree on most important Key Performance Indicators and have them communicated to entire company. Train people accordingly so that they know which behavior leads to rewarding results.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (42, 175, 'Adding real value to your customers is about creating a relationship that can not be copied by your competitors. It is about knowing your customers true pains.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (43, 176, 'FInd out your customers buying process and adjust your value sales process accordingly. Focus on relationships more than product and services.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (45, 178, 'Processes is the fuel in the company engine. Better quality of fuel creates better results. Process efficiency is about getting better results with less energy used. That requires resourcefullness. It is about continous improvement in everyday work. As an example: If you have a 12 step process and every process is tuned to get 3% better output, the result will be +40% total improvement.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (46, 179, 'Appoint one person or small team to go through all processes in the company. Usually a person from outside the company sees things more objectively. Start developing small things bit by bit.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (11, 146, 'There is a "we can" attitude in our team', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:58:35.372000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (48, 227, 'We are good at creating new ideas and turning them into action ', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:54:57.180000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (34, 168, 'I get a sense of purpose from my work', 'en', '2018-08-30 08:13:46.735543', '2018-09-11 08:28:43.571000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (51, 147, '我在工作中可以发挥最大潜能', 'zh', '2018-08-30 08:13:46.735543', '2018-12-12 07:10:49.019000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (38, 172, 'People are taken good care of in our company', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:31.655000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (39, 173, 'Our working culture is inspiring', 'en', '2018-08-30 08:13:46.735543', '2018-09-11 08:29:11.647000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (19, 154, 'Right people on board  ', 'en', '2018-08-30 08:13:46.735543', '2018-09-25 12:44:41.353000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (36, 170, 'Our dialogue focuses on solutions ', 'en', '2018-08-30 08:13:46.735543', '2019-01-25 04:13:54.185000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (10, 145, 'We have a culture that supports individual growth', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:58:24.237000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (37, 171, 'We receive and give feedback actively and constructively in our everyday work', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:59:47.635000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (33, 167, 'We act according to our values', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:50:39.197000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (12, 147, 'I can use my full potential in my work ', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:46:47.036000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (14, 149, 'I get feedback about things that could be done better', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:58:48.324000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (18, 153, 'I have the necessary competences to succeed in my job', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:50:06.329000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (32, 166, 'People have ownership to fulfill their responsibilities', 'en', '2018-08-30 08:13:46.735543', '2018-11-19 10:37:22.142000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (17, 152, 'We have a good mix of different people working in our company', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:58:58.964000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (15, 150, 'We have positive change energy in our company', 'en', '2018-08-30 08:13:46.735543', '2018-09-11 08:27:39.734000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (31, 165, 'It is ok to make mistakes in our company', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:10.421000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (35, 169, 'Our team is functioning well', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:17.135000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (16, 151, 'I feel a sense of progress and achievement in my work', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:58:53.616000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (40, 174, 'Compelling community', 'en', '2018-08-30 08:13:46.735543', '2018-09-25 12:45:01.341000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (49, 145, '我们的工作文化支持个人的成长', 'zh', '2018-08-30 08:13:46.735543', '2018-09-14 04:48:23.839000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (50, 146, '我们的团队具有“我们可以”的态度', 'zh', '2018-08-30 08:13:46.735543', '2018-09-14 04:48:55.375000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (13, 148, 'We recruit right people into right positions in our organisation', 'en', '2018-08-30 08:13:46.735543', '2018-12-12 07:32:22.888000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (41, 174, '<p> 齐心合力的工作集体</p>', 'zh', '2018-08-30 08:13:46.735543', '2018-09-17 20:25:58.600000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (3, 137, 'Motivation', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (20, 154, '<p> 用正确的人</p>', 'zh', '2018-08-30 08:13:46.735543', '2018-09-17 20:25:39.060000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (8, 143, 'Adaptability', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (23, 157, 'Trust', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (9, 144, 'People are willing to give their best in our organisation ', 'en', '2018-08-30 08:13:46.735543', '2018-11-19 10:32:33.011000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (53, 149, '对于工作中需要提升的方面我得到足够的反馈', 'zh', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (68, 181, 'To be innovative means to create new commercialized solutions for customers. Innovation is everyones job, not only for those who design products.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (69, 182, 'Train your leaders in how to facilitate an innovation workshop and start using the WeCan innovation tool.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (147, 240, 'Employee', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (148, 240, '员工', 'zh', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (83, 195, 'Everything is done inside a certain time frame. Whatever we put into that fram, we get out. Since time is ticking on how we use our time is one of the most crucial determinants of success.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (84, 196, 'Make a clear list of 5 most important priorities for all company departments and train people about why these priorities are so important.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (86, 198, 'Priorities and individual time management affects team output and thereby to the entire culture of company. When people know more exactly how they should use their time, they will use less energy for better output. Purposeful individual time usage requires knowledge and acceptance about what our company is all about and what goal we have.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (87, 199, 'Go through with every employee their main tasks and priorities, explaining why certain priorities are more important than others.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (89, 201, 'Every person has their own special talents, skills and roles. The more people can focus on doing the work that comes most naturally to them, the better will the productivity be.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (90, 202, 'Train your employees to focus on their tasks and openly delegate things to the right person when something is not working well for them.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (103, 215, 'We are different as human beings, with different needs and strenghts. It is important to know why and how we are different, so that we can create a safe culture inside our company.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (104, 216, 'Conduct a culture survey and map the entire staff according to their traits, competencies, skills and experiences.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (106, 218, 'Having a clear vision and working according to company values are two of the most important components of excellence. Values should be understood on a practical level so that people understand what is expected of them.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (75, 188, 'We concentrate on producing and adding value to our customers', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:48.657000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (76, 189, 'We are good at combining customer value and profitability', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:54.244000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (80, 193, 'We are constantly tracking and adapting to customer demands', 'en', '2018-08-30 08:13:46.735543', '2018-11-19 10:40:35.390000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (77, 190, 'Our customers are loyal to us', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:59.060000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (78, 191, 'Our products / services are easy to understand and purchase', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:03.820000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (92, 204, 'I am able to work according to agreed priorities', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:09.978000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (93, 205, 'We delegate efficiently when useful to do so', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:14.824000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (95, 207, 'I have the necessary tools to succeed in my work', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:53:59.198000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (94, 206, 'We are good at keeping schedules', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:19.848000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (97, 209, 'We have useful and lean processes ', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:54:12.394000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (96, 208, 'Our IT-systems as  a whole are easy to use', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:23.855000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (81, 194, 'Superior Customer Experience', 'en', '2018-08-30 08:13:46.735543', '2018-09-25 12:45:11.566000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (101, 213, 'I know exactly what my roles and responsibilities are', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:54:31.854000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (99, 211, 'We have effective shared practices', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:33.061000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (73, 186, 'Our product/service development is customer focused', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:44.422000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (61, 167, '我们根据我们的价值观而行动', 'zh', '2018-08-30 08:13:46.735543', '2018-12-12 07:14:32.209000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (74, 187, 'Our customer considers us superior to our competitors', 'en', '2018-08-30 08:13:46.735543', '2019-01-25 04:20:35.709000', false);
