INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (361, 567, 'Privacy Policy', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (362, 568, '<p><h2>1 Data controller</h2><p>weCan5 Oy, Business ID 2082238-6, address c/o Renesans Consulting Oy, Kasarmikatu 36, 00130 Helsinki.</p><h2>2 How to contact us</h2><p>If you have any questions or concerns about how we process your personal information or this Privacy Policy in general, or if you wish to apply for your rights, please contact us:</p><p>Lasse Wendelin, lasse.wendelin@wecan5.com,  + 86 130 6274 8040 ja + 358 400 241190.</p><h2>3 Name of registers</h2><p>weCan services (thereinafter "application" or "service") register and database</p><h2>4 What personal information do we collect?</h2><p>We collect, process and store the following personal information:  </p><ul><li>name, group, email address, phone number, language, gender, age, duration of employment, industry, country, time zone and password;</li><li>survey answers and statistics;</li><li>cached information needed to make the service available;</li><li>the user''s own settings, IP address and visited pages for statistical purposes;</li><li>event data timestamps;</li><li>messages sent to the service;</li><li>information related to automatically collected audit and security events.</li></ul><p>As far as login is concerned, information about the success or failure of login is stored. If the transaction is interrupted due to an error, the information is stored related to the cause of the error.</p><h2>5 Legal basis for processing personal information</h2><p>Our legal basis for collecting and using the personal information described above will depend on the personal information concerned and the specific context in which we collect it.</p><p>However, we will normally collect personal information from you only (i) where the processing is in our legitimate interests and not overridden by your rights, or (ii) where we have your consent to do so.</p><p>(a) We process your personal data on the basis of our legitimate interests for example when we provide you the resulting survey report, for engineering purposes, for data analytics purposes, for improving the user experience.</p><p>(b) We have Legal obligation to process your personal data when to comply with a legal obligation, such as the prevention of crime or fraud.</p><p>(c) If we ask you to provide personal information to comply with a legal requirement, we will make this clear at the relevant time and advise you whether the provision of your personal information is mandatory or not (as well as of the possible consequences if you do not provide your personal information).</p><h2>6 How we use your personal information</h2><p>The information in the register is processed to identify service users and to protect personal information processed and to ensure information security, to troubleshoot errors and to identify possible abuses and data breaches.</p><p>The register is also maintained for the following purposes:</p><ul><li>Determining the usage level of the application;</li><li>Monitoring costs and division of costs;</li><li>For statistical needs. When data is used for statistical purposes, information is disclosed such that an individual is not identifiable;</li><li>Providing, personalizing and developing an application;</li><li>Ensuring the functionality of the application, developing new features and functionalities and providing support;</li><li>Data exploration, analysis and use of the application;</li><li>Communication required to manage the user relationship.</li></ul><h2>7 Who does weCan5 share my personal data with?</h2><p>Personal information will not be disclosed to other parties than the third parties involved in the production of the service with the exceptions listed below.</p><p>We may share your personal information: </p><p>(a) To our group companies, third party services providers and partners who provide data processing services to us (for example, to support the delivery of, provide functionality on, or help to enhance the security of our service), or who otherwise process personal information for purposes that are described in this Privacy Policy or notified to you when we collect your personal information.</p><p>(b) to any competent law enforcement body, regulatory, government agency, court or other third party where we believe disclosure is necessary (i) as a matter of applicable law or regulation, (ii) to exercise, establish or defend our legal rights, or (iii) to protect your vital interests or those of any other person;</p><p>(c) to a potential or actual buyer (and its agents and advisers) in connection with any proposed or actual purchase, merger or acquisition of any part of our business, provided that we inform the buyer it must use your personal information only for the purposes disclosed in this Privacy Policy;</p><p>(d) to any other person with your consent to the disclosure.</p><h2>8 International data transfer</h2><p>As a general rule, weCan5 Oy will not transfer or disclose your personal information outside of the European Union or the European Economic Area. However, information may, if necessary, be transferred or transferred outside of the European Union or the European Economic Area in the manner permitted by the Personal Data Act if:</p><ul><li>the data will be transferred to a country where the European Commission has determined that the level of data protection is sufficient, or;</li><li>contractual arrangements can guarantee an adequate level of protection, or;</li><li>provided that the person or customer has given their consent.</li></ul><h2>9 How does weCan5 keep my personal information secure?</h2><p>We use appropriate technical and organisational measures designed to protect the personal information that we collect and process about you. The measures we use are designed to provide a level of security appropriate to the risk of processing your personal information.</p><p>Specific measures we use include restricting access to and encrypting your personal information in transit and at rest.</p><h2>10 Data retention</h2><p>We retain personal information we collect from you where we have an ongoing legitimate business need to do so, for example, to provide you the weCan service or to comply with applicable legal, tax or accounting requirements. <p></p>When we have no ongoing legitimate business need to process your personal information, we will either erase or de-identify it or, if this is not possible - for example, because your personal information has been stored in backup archives - then we will securely store your personal information and isolate it from any further processing until erasure is possible.<p><h2>11 Your data protection rights</h2><p>You have the following data protection rights:</p><p>(a) To access correct, update or request deletion of your personal information. You may do so by contacting us using the details at "How to Contact Us" heading above.</p><p>(b) To object to processing of your personal information (which is processed on the grounds of legitimate interests), ask us to restrict processing of your personal information or request portability of your personal information. Again you may do so by contacting us using the details at "How to Contact Us" heading above.</p><p>(c) To opt-out of marketing communications we send you at any time. You can exercise this right by clicking on the “unsubscribe / opt-out” link in the marketing communications we send you or by contacting us using the details at "How to Contact Us" heading above.</p><p>(d) If we are processing your personal information with your consent, you can withdraw your consent at any time. Withdrawing your consent will not affect the lawfulness of any processing we conducted prior to your withdrawal, nor will it affect processing of your personal information conducted in reliance on lawful processing grounds other than consent. You may do so by contacting us using the details at "How to Contact Us" heading above.</p><p>(e) You have the right to complain to a data protection authority about our collection and use of your personal information. For more information, please contact your local data protection authority.We will respond to all requests we receive from individuals wishing to exercise their data protection rights in accordance with applicable data protection laws.</p><h2>12 Cookies and similar tracking technology in websites</h2><p>The service may use “cookies” and other technologies such as pixel tags, local shared objects, hardware-based device identifiers, flash cookies, operating system-based identifiers, clear GIFs and web beacons.</p><p>Cookies: A “cookie” is a small file stored by your device when told to do so by a website. Typically websites place a number of different cookies on an end-user’s device. Some of the cookies are “1st party,” from the website itself, and others are “3rd party,” belonging to advertising and analytics entities or social networks. </p><p>Cookies are personal information. However, weCan5’s cookies do not include any other personal information and are typically used to quickly identify your device and to “remember” your device during subsequent visits for purposes of functionality, preferences, and website performance. You can disable cookies on your device or set your device to alert you when cookies are being sent to your device; however, disabling cookies may affect your ability to use the service.</p></p>', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
