INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (432, 568, '<p><h2>1 Rekisterinpitäjä</h2><p>weCan5 Oy, y-tunnus 2082238-6, osoite c/o Renesans Consulting Oy, Kasarmikatu 36, 00130 Helsinki.</p><h2>2 Yhteyshenkilö rekisteriä koskevissa asioissa</h2><p>Jos sinulla on kysyttävää tai huolia siitä, miten käsittelemme henkilötietojasi tai tästä tietosuojaselosteesta yleisesti, tai jos haluat esittää oikeuksiesi käyttämistä koskevan pyynnön, ota meihin yhteyttä:</p><p>Lasse Wendelin, lasse.wendelin@wecan5.com,  + 86 130 6274 8040 ja + 358 400 241190.</p><h2>3 Rekisterin nimi</h2><p>weCan-verkkopalveluiden (jäljempänä "sovellus" tai "palvelu") rekisteri ja tietokanta</p><h2>4 Henkilötietojen käsittelyn tarkoitus</h2><p>Rekisteri on weCan-sovelluksen rekisteri ja tietokanta:</p><ul><li>Sovelluksien rekisteri tarkoittaa palveluiden välimuistiin tallennettuja tietoja.</li><li>Sovelluksien tietokanta tarkoittaa palveluiden tietokantaan tallennettuja tietoja.</li></ul><p>Rekisterin henkilötietoja käsitellään EU:n tietosuoja-asetuksen 2016/679  mukaisesti palveluissa tapahtuneen tietojenkäsittelyn oikeellisuuden osoittamiseksi ja muutoin palvelujen tuottamiseksi ja kehittämiseksi sekä niiden toimivuudesta ja tietoturvallisuudesta huolehtimiseksi.</p><p>Rekisterin avulla pidetään yllä tietoa niistä käyttäjistä, jotka ovat rekisteröityneet palveluun ja tallentaneet omia asetuksiaan (oma profiili). Rekisterin avulla pidetään myös yllä tietoa palveluiden käytöstä. </p><p>Palveluihin kirjautuminen edellyttää tunnistautuneen käyttäjän henkilötietojen tallentamista (sähköpostiosoite, nimi, puhelinnumero, ikä ja sukupuoli). </p><p>Rekisterin tietoja käsitellään palveluiden käyttäjien yksilöimiseksi ja palveluissa käsiteltävien henkilötietojen suojaamiseksi ja tietoturvallisuuden varmistamiseksi, virhetilanteiden selvittämiseen sekä mahdollisten väärinkäytösten ja tietosuojaloukkausten selvittämiseen.</p><p>Rekisteriä ylläpidetään myös seuraaviin tarkoituksiin: </p><ul><li>Sovelluksen käytön määrän sekä kustannusten seurannan ja jaon selvittäminen;</li><li>Käytön tilastointitarpeisiin. Tilastointitarpeisiin tietoja käytettäessä tiedot julkaistaan siten, että yksittäinen henkilö ei ole tunnistettavissa;</li><li>Sovelluksen tarjoaminen, personointi ja kehittäminen;</li><li>Sovelluksen toimivuuden varmistaminen, uusien ominaisuuksien ja toiminnallisuuksien kehittäminen ja tuen tarjoaminen;</li><li>Sovelluksen käytön tutkiminen, analysointi ja käyttöön liittyvien tilastojen laatiminen;</li><li>Käyttäjäsuhteen hallinnoimiseksi tarpeellinen viestintä.</li></ul><h2>5 Rekisterin tietosisältö</h2><p>Henkilötiedoista tallennetaan rekisteriin seuraavat tiedot:</p><ul><li>nimi, ryhmä, sähköpostiosoite, puhelinnumero, kieli, sukupuoli, ikä, työsuhteen kesto, toimiala, maa, aikavyöhyke ja salasana;</li><li>vastaukset palveluiden kysymyksiin ja siihen liittyvä statistiikka;</li><li>palveluiden hyödyntämiseen tarpeelliset, välimuistiin tallennettavat tiedot;</li><li>käyttäjän tekemät omat asetukset, IP-osoite ja vieraillut sivut tilastointia varten;</li><li>tapahtumatietojen aikaleimat;</li><li>palveluun toimitettavat viestit;</li><li>tapahtumatietorekisterin tietyt tiedot ja niiden selitteet.</li></ul><p>Kirjautumisen osalta tallennetaan tieto kirjautumisen onnistumisesta tai epäonnistumisesta. Jos asiointitapahtuma keskeytyy virheen vuoksi, tallennetaan tieto virheen syystä.</p><h2>6 Säännön mukaiset tietolähteet</h2><p>Asiakkaaseen liittyviä tietoja kerätään asiakkaalta itseltään sopimuksen tekemisen yhteydessä, sovelluksien oma profiili -osiossa, palvelujen käytön yhteydessä ja asiakaspalvelun yhteydessä.</p><h2>7 Tietojen säännönmukaiset luovutukset</h2><p>Asiakkaan henkilötietoja ei luovuteta weCan5 Oy:n lukuun toimivien tai palvelukokonaisuuden tuottamiseen osallistuvien kolmansien tahojen ulkopuolelle.</p><h2>8 Tietojen siirto EU:n tai ETA:n ulkopuolelle</h2><p>Pääsääntöisesti weCan5 Oy ei siirrä tai luovuta asiakkaan henkilötietoja Euroopan unionin tai Euroopan talousalueen ulkopuolelle. Tietoja voidaan kuitenkin tarvittaessa siirtää tai luovuttaa Euroopan unionin tai Euroopan talousalueen ulkopuolelle henkilötietolain sallimilla tavoilla mikäli:</p><ul><li>tiedot siirretään maahan, jossa Euroopan komissio on todennut tietosuojan tason olevan riittävä, tai;</li><li>sopimusjärjestelyin voidaan taata tietosuojan riittävä taso, tai;</li><li>mikäli asiakas on antanut siihen suostumuksensa.</li></ul><h2>9 Rekisterin suojauksen periaatteet</h2><p>weCan5 Oy:n rekisterin tietoturvallisuus sekä henkilötietojen luottamuksellisuus, eheys ja käytettävyys varmistetaan tarkoituksenmukaisin teknisin ja hallinnollisin toimenpitein. Tietoja ja palvelua suojataan muun muassa palomuurin, fyysisten laitetilojen suojaamisen, kulunvalvonnan, käyttöoikeuksien ja salaustekniikoiden sekä edellä mainittujen aktiivisen valvonnan kautta. Henkilötiedot suojataan asiattomalta pääsyltä ja laittomasti tai vahingossa tapahtuvalta tietojenkäsittelyltä.</p><p>Henkilötietoja käsittelevät vain weCan5 Oy:n erityisesti määrittelemät henkilöt, jotka ovat yhtiön palveluksessa, sekä weCan5 Oy:n toimeksiannosta palveluja ylläpitävät tai kehittävät kolmannet osapuolet. Nämä tunnistautuvat järjestelmiin henkilökohtaisen käyttäjätunnuksen ja salasanan avulla.</p><p>Sovelluksien tietoliikenne on salattua ja asiakas tunnistaa kyseisen palvelun osoitteen oikeellisuuden varmenteesta.</p><h2>10 Tarkastusoikeus</h2><p>Asiakkaalla on henkilötietolain 26 – 28 §:n mukaisesti oikeus tarkastaa, mitä häntä koskevia tietoja rekisteriin on tallennettu. Joidenkin tietojen saamista on kuitenkin rajoitettu mm. rikosten ehkäisemisen ja selvittämisen vuoksi.</p><p>Asiakas voi tarkistaa perustietonsa sekä tapahtumatietojaan osittain myös tunnistautuneena palveluihin. </p><p>Tarkastuspyyntö tehdään toimittamalla kirjallinen ja allekirjoitettu tarkastuspyyntö osoitteella: weCan5 Oy, y-tunnus 2082238-6, osoite c/o Renesans Consulting Oy, Kasarmikatu 36, 00130 Helsinki.</p><p><p>Tarkastuspyynnössä tulee mainita nimi, henkilötunnus, postiosoite ja puhelinnumero. Tarkastuspyynnön vastaus toimitetaan asiakkaan varmennettuun osoitteeseen.</p><h2>11 Oikeus vaatia tiedon korjaamista</h2><p>Asiakkaalla on oikeus: </p><ul><li>tarkistaa, päivittää, poistaa ja korjata henkilötietoja;</li><li>peruuttaa suostumus, jos henkilötietojen käsittely perustuu suostumukseen;</li><li>vastustaa henkilötietojen käsittelyä;</li><li>vaatia rajoittamaan henkilötietojen käsittelyä; ja</li><li>saada henkilötietonsa koneluettavassa muodossa ja siirtää kyseiset tiedot toiselle rekisterinpitäjälle edellyttäen, että olet toimittanut kyseiset henkilötiedot meille ja että käsittelemme henkilötietojasi suostumuksesi perusteella. Voit esittää edellä mainittuja oikeuksia koskevan pyyntösi ottamalla meihin yhteyttä henkilökohtaisesti, kirjeitse tai sähköpostitse tämän tietosuojaselosteen kohdassa 2 ja 10 annettuun osoitteeseen. Voimme pyytää sinua tarkentamaan pyyntöäsi kirjallisesti ja varmentamaan henkilöllisyytesi ennen pyyntösi käsittelemistä.</li></ul><p>Jos et ole tyytyväinen siihen, miten käsittelemme henkilötietojasi, sinulla on oikeus tehdä valitus toimivaltaiselle valvontaviranomaiselle, joka valvoo henkilötietojen käsittelyyn sovellettavan lainsäädännön noudattamista.</p><h2>12 Evästeiden käsittely</h2><p>Jos et hyväksy evästeiden käyttöä, voit poistaa ne käytöstä selaimen suojausasetuksista. Voit myös asettaa selaimen asetukset siten, että saat varoituksen joka kerta, kun verkkosivusto yrittää tallentaa evästeen tietokoneellesi. Aiemmin tallennetut evästeet voi myös poistaa selaimen kautta.</p><p>Selaimen ohjesivuilla on lisää tietoa selaimeen tallennettujen evästeiden tarkastelusta, niiden poistamisesta sekä evästeiden hyväksymiseen liittyvien asetusten tekemisestä.</p></p>', 'fi', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
