INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (441, 507, '<p>在第一阶段，你需要填写一些个人信息。 之后，你会看到50个工作中典型情景的描述。 观点是从你自己、你最密切的团队和整个组织的角度来考虑的。</p><p>回答你对所有问题的看法需要大约20分钟的时间。不要过多地去考虑答案：你回答得越诚实，结果就越可靠。 所有问题都必须回答，我们建议您一次性完成调查。</p><p>没有人能够看到你对个别问题的回答。</p>', 'zh', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
