INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (506, 1, '<h2>Hei!</h2><p>Kutsumme sinut vastaamaan työpaikkakyselyyn täällä:</p><p><a href="{{ surveyLinkFI }}">weCan Kysely</a></p><p>Kyselyyn vastaaminen vie noin 20 minuuttia.</p><p>Kiitos,<br/>weCan<br/>www.wecan5.com</p>', 'fi', '2018-08-30 08:13:47.527770', '2018-08-30 08:13:47.527770', false);
