INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (658, 54, '<p><br></p>', 'fi', '2018-09-13 12:05:45.945000', '2018-09-13 12:05:45.945000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (661, 57, '<p>weCan method is a result of 20 years of practical experience and ongoing qualitative studies among 100+ organizations and thousands of participants in growth workshops, in more than 30 countries. The chosen five catalysts are found as major contributors to organisational progress and profitability, regardless of culture, location or size of the organization.</p><p>weCan focuses not only on finding the growth pockets but also provides practical steps for progress implementation. The ability to compare different individuals, teams and departments with each other gives a possibility to allocate resources based on optimal change management. The philosophy behind weCan is that by changing your everyday activities according to analysed growth opportunities the results will appear. Only by starting to do something differently a change can be reality.</p>', 'en', '2018-10-03 05:25:06.839000', '2018-10-03 05:25:06.839000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (662, 58, '<p>Your growth opportunities </p>', 'en', '2018-10-03 05:26:09.395000', '2018-10-03 05:26:09.395000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (206, 214, 'Operational Excellence', 'en', '2018-08-30 08:13:46.735543', '2018-09-25 12:45:23.203000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (300, 506, 'Welcome to weCan Survey', 'en', '2018-08-30 08:13:46.735543', '2018-10-23 11:26:42.041000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (270, 227, 'Olemme hyviä ideoinnissa ja ideoiden muuttamisessa toiminnaksi', 'fi', '2018-08-30 08:13:46.735543', '2018-12-12 07:31:20.994000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (659, 55, '<p>Above are your total growth scores and estimates of how your growth pockets are divided between each of the five catalysts. Based on your answers you also find your scores for the three growth drivers of each catalyst. There are totally 15 different growth drivers and they represent all the main growth opportunities. In other words these drivers can be seen as separate growth projects, with specific goals, tools and KPI:s.</p><p>The weCan algorithm is based on science and thorough empirical findings. Therefore, each one of the statements that you have answered have a unique weight and causal effect on the growth percentages.</p><p>Progress occurs when you start doing something differently than before. Change is about new habits done repeatedly in the same direction. Not every new action lead to growth. Actions have to be carefully chosen and carry a purpose.</p><p>When you study this report carefully you will find new ways to succeed. Please remember that one of the best KPI:s for success is your speed to impact. The sooner you start leading the change towards your real potential, the sooner the new results will show.</p>', 'en', '2018-09-14 12:08:10.027000', '2018-10-03 05:21:14.087000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (663, 59, '<p>Group</p>', 'en', '2018-10-03 05:27:28.621000', '2018-10-03 05:27:28.621000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (664, 60, '<p>Organisation</p>', 'en', '2018-10-03 05:29:42.045000', '2018-10-03 05:29:42.045000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (665, 61, '<p>Respondents</p>', 'en', '2018-10-03 05:31:29.592000', '2018-10-03 05:31:29.592000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (666, 62, '<p>Self motivation is necessary for self management and a basic driver for productivity. Motivation is created from inside out. In practice we can not be motivated by others directly, only by the circumstances that are created.</p>', 'en', '2018-10-03 05:39:02.405000', '2018-10-03 05:39:02.405000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (669, 65, '<p>How to make it in practice?</p>', 'en', '2018-10-03 05:42:45.901000', '2018-10-03 05:42:45.901000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (670, 66, '<p>It is normally better to increase strengths first and after that focus on reducing weaknesses. By focusing on the future potential of co-workers you create a frame for growth and a healthy culture of growth.</p>', 'en', '2018-10-03 05:47:14.758000', '2018-10-03 05:48:56.443000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (671, 67, '<p>Why is this important?</p>', 'en', '2018-10-03 05:49:47.133000', '2018-10-03 05:49:47.133000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (667, 63, '<ul><li>Motivation is the driving force for any habitual change.</li><li>Clarifying your goals is key for motivation.</li><li>The best motivation is created when expectations towards each other are similar.</li><li>Clear purpose helps enduring short term pain for long term benefits.</li></ul>', 'en', '2018-10-03 05:40:24.989000', '2018-10-03 06:40:39.965000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (668, 64, '<ul><li>You understand better how to use your motivation for achieving goals.</li><li>You learn to adjust your habits and actions according to your motivational drivers.</li><li>You learn to increase your tolerance area.</li><li>Your knowledge of other peoples motivational drivers increase.</li></ul>', 'en', '2018-10-03 05:42:09.275000', '2018-10-03 06:40:50.808000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (672, 68, '<ul><li>You perform on your best level when focusing on future potential.</li><li>Your potential is a sum of genetic abilities, experience, learned skills and your attitude.</li><li>Understanding and accepting your genetic abilities is a crucial starting point for building new potential.</li></ul>', 'en', '2018-10-03 05:52:22.715000', '2018-10-03 06:41:11.864000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (660, 56, '<p>Welcome to the weCan world of growth and congratulations for new possibilities!</p><p>Thank you for taking the opportunity to start the journey towards growth. The weCan method consists of five steps</p><ul><li>Ask the right questions</li><li>Learn where you are now</li><li>Focus on the essential growth areas</li><li>Implement for growth and success</li><li>Repeat for continuous progress</li></ul><p>This report is an estimate based on the statements that you have answered. Your total growth potential is visible in the weCan diamond above. Your progress depends on how you relate to these areas.</p><p>Success starts with the ability to see your best potential. Seeing is essential and it needs to be combined with understanding about what and how to do it in practice.</p>', 'en', '2018-10-03 05:02:59.355000', '2018-11-20 13:21:46.709000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (683, 79, '<ul><li>Arrange workshops where you train yourselves in receiving and giving praise and feedback.</li><li>Make teams and co-workers accountable for their decisions and actions.</li><li>Discuss and decide better techniques and ways of communication and dialogue, to avoid unnecessary misunderstandings.</li><li>Discuss the level of trust is in your team and make an action plan of how to increase it.</li></ul>', 'en', '2018-10-03 06:48:20.901000', '2018-10-03 06:50:00.928000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (681, 77, '<ul><li>Train everyone in how to understand basics of human behaviour and motivation.</li><li>Start every team meeting with a short 10 minutes discussion about motivation.</li><li>Collect answers from every individual about what their main motivators are.</li><li>Start noticing self-motivated behaviour and giving praise for that.</li></ul>', 'en', '2018-10-03 06:41:01.217000', '2018-10-03 06:41:01.217000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (673, 69, '<ul><li>Work-life balance gets better when focusing on potential.</li><li>Your productivity is a result of using your strengths and potential.</li><li>Innovative solutions appear more often when operating inside the potential area.</li><li>Your ability to recover from unpleasant situations increase when you focus on potential instead of shortcomings.</li></ul>', 'en', '2018-10-03 05:56:55.471000', '2018-10-03 06:41:23.307000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (674, 70, '<ul><li>Conduct a strengths survey of all employees.</li><li>Arrange practical workshops where you focus on discussing future potential on individual level.</li><li>Map individual growth goals and potential areas.</li><li>Create specific and goal oriented growth plans for individuals and teams.</li></ul>', 'en', '2018-10-03 06:01:49.922000', '2018-10-03 06:41:33.539000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (676, 72, '<ul><li>How you focus determines where your energy flows, and energy is a scarce resource.</li><li>You need to feel that you are the driver and not the passenger.</li><li>How you interpret different events has a direct impact on the level of satisfaction and motivation.</li><li>Sleep, diet and exercise are crucial ingredients for emotional mastery because they build up your energy resources.</li></ul>', 'en', '2018-10-03 06:15:32.505000', '2018-10-03 06:41:45.220000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (675, 71, '<p>Emotional mastery is about having the feeling of inner control even in challenging situations at work, letting go of autopilot, to stop and respond instead of react. Being present and make an intentional choice, by creating a ”distance” between stimuli and respons, believing that you have more opportunities than challenges.</p>', 'en', '2018-10-03 06:08:27.722000', '2018-10-03 06:20:18.237000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (684, 80, '<p>Roles in a team is a key factor for team and individual performance. Roles have two dimensions: individual role for the team member and secondly the role of the team itself. When roles are clear, you enable both responsibility and accountability.</p>', 'en', '2018-10-03 06:51:24.911000', '2018-10-03 06:51:24.911000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (679, 75, '<p>All companies consists of teams of different sizes. Mutual trust is a crucial element in establishing alignment, accountability and thereby results. Trust is fundamental for receiving constructive feedback and adjusting behaviour.</p>', 'en', '2018-10-03 06:32:42.017000', '2018-10-03 06:32:42.017000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (677, 73, '<ul><li>People with high degree of emotional strength are productive and future oriented.</li><li>Focusing on possibilities creates accountability and responsibility.</li><li>Responding instead of reacting gives you a sense of control, purpose and direction.</li><li>You understand that you are the only real expert of your own life and responsible for your choices.</li></ul>', 'en', '2018-10-03 06:22:22.985000', '2018-10-03 06:41:51.608000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (678, 74, '<ul><li>Create a training program in how to use practical self management tools in everyday work.</li><li>Make emotional mastery to one of your team´s most important building blocks.</li><li>Arrange a workshop where you discuss and communicate the standards and expectations for emotional mastery.</li></ul>', 'en', '2018-10-03 06:23:48.568000', '2018-10-03 06:42:07.375000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (680, 76, '<ul><li>Trust is the multiplicator of efforts in any community. </li><li>Trust is more than doing what you promise. It is showing openness and being vulnerable.</li><li>As social human beings we have a strong need for safety within a group. Trust is a key element for feeling safe.</li><li>Changes in business environments require acceptance to deviations from plans, and trust is an enabler to this.</li></ul>', 'en', '2018-10-03 06:37:11.474000', '2018-10-03 06:39:57.553000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (682, 78, '<ul><li>Co-workers, customers and leaders can be sure that there are no hidden agendas.</li><li>New ideas and creative solutions is put on the table thanks to openness and deeper levels of communication.</li><li>When feeling safe and trusted feedback is interpreted constructively.</li><li>It easier to create cross-functional collaboration when teams focus enough on building trust.</li></ul>', 'en', '2018-10-03 06:44:36.211000', '2018-10-03 06:44:36.211000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (690, 86, '<ul><li>Make sure that there is a buy-in and engagement for team rules and the mutual expectations for accountability.</li><li>Provide continuous training and feedback based on results.</li><li>Arrange workshops where you communicate what kind of behaviours lead to rewards.</li><li>Reward people when they have shown ownership and when they have taken responsibility even if things went wrong and it was not their fault.</li></ul>', 'en', '2018-10-03 07:04:37.088000', '2018-10-03 07:04:37.088000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (685, 81, '<ul><li>Well defined roles and responsibilities increase the level of autonomy and self motivation.</li><li>When you know what is expected from each other and what to do next there is less space for excuses and blame.</li><li>Individuals, teams and company all have separate roles and therefore they need to be clarified.</li></ul>', 'en', '2018-10-03 06:51:54.935000', '2018-10-03 06:51:54.935000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (686, 82, '<ul><li>Productivity and profitability increases when you know what, when, how and with whom to do the necessary tasks.</li><li>Clear roles increases responsibility, releases capacity and saves time.</li><li>When synergy is high your team becomes proactive and you get more time to add value to customers.</li></ul>', 'en', '2018-10-03 06:54:14.956000', '2018-10-03 06:54:14.956000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (687, 83, '<ul><li>Discuss, define and ensure roles and the practical understanding of them in everyday work. </li><li>Discuss frequently how roles should be redesigned for optimal resource allocation and output. </li><li>Train your team to engage in the team vision and strategy.</li><li>Agree on practical habits to ensure synergies.</li></ul>', 'en', '2018-10-03 07:00:01.786000', '2018-10-03 07:00:01.786000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (688, 84, '<ul><li>Success is about individual ownership, shown in everyday work with each other.</li><li>Other team members has the right to expect mutual accountability for results.</li><li>With the attitude of accountability you see more opportunities than obstacles.</li><li>The team can''t release you from your own accountability, and likewise the company needs to hold the team accountable for end results.</li></ul>', 'en', '2018-10-03 07:01:21.740000', '2018-10-03 07:01:21.740000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (689, 85, '<ul><li>When everyone accepts ownership, all processes flow and productivity thrive</li><li>With attitude of ownership, delegation leads to better total performance.</li><li>With a CAN DO attitude the willingness to walk the extra mile for customers increases</li><li>When you can hold each other accountable for actions the end results and profitability will thrive.</li></ul>', 'en', '2018-10-03 07:02:46.143000', '2018-10-03 07:02:46.143000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (707, 575, 'Tolkku ja Tulokset Tekemisessä', 'fi', '2018-11-15 12:00:53.511000', '2018-11-15 12:00:53.511000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (708, 575, 'Operational Excellence', 'en', '2018-11-15 12:00:53.512000', '2018-11-15 12:00:53.512000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (709, 575, '<p> 卓越运营</p>', 'zh', '2018-11-15 12:00:53.513000', '2018-11-15 12:00:53.513000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (691, 87, '<p>When your customer´s experience exceeds their expectations you add real value to your relationship. Understanding the customer is a necessity in building up the customer value.</p>', 'en', '2018-10-03 12:36:05.630000', '2018-10-03 12:36:56.221000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (692, 88, '<ul><li>The main differentiator between you and your competitors is the added value that your customers get from you.</li><li>By constantly adding new value to your customers you ensure growth.</li><li>Most technologies and products can be copied. The real difference is in the unique and uncopyable relationship between you and your customers. </li><li>A systematic approach forces you to be active in every step of the process.</li></ul>', 'en', '2018-10-03 12:40:39.384000', '2018-10-03 12:41:42.469000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (693, 89, '<ul><li>You attract more customers when you systematically add more value to them.</li><li>Customers remain longer because they feel valued. You gain more predictability and increased accuracy to your sales strategies.</li><li>Customer profitability increases</li><li>Instead of providing solutions you also create new profitability pockets mutually.</li></ul>', 'en', '2018-10-03 12:43:12.346000', '2018-10-03 12:43:12.346000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (731, 583, 'Asiakasarvo', 'fi', '2018-11-15 12:00:53.562000', '2018-11-15 12:00:53.562000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (733, 583, '客户价值', 'zh', '2018-11-15 12:00:53.563000', '2018-11-15 12:00:53.563000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (734, 584, 'Tuotteet & palvelut', 'fi', '2018-11-15 12:00:53.565000', '2018-11-15 12:00:53.565000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (405, 541, '<p>Ota kantaa väittämiin sen mukaisesti, mitä viimeisten viikkojen aikana olet ajatellut. Yleensä paras vastaus on se, mikä ensimmäisenä tulee mieleesi. Jos et työskentele osana tiimiä, käytä tarkastelukohteena koko organisaatiota.</p>', 'fi', '2018-08-30 08:13:46.735543', '2018-10-08 11:21:41.637000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (371, 507, '<p>Väittämissä on käytetty kolmea eri näkökulmaa: sinä yksilönä, lähin tiimi tai ryhmä johon kuulut, sekä koko organisaatio. Käytä näkökulmana aina omaa tiimiäsi mikäli väittämässä ei toisin mainita.</p><p>Suosittelemme vastaamaan koko kyselyyn kerralla. Aikaa vastaamiseen kuluu yleensä noin 20 minuuttia.</p><p>Kun olet ensin vastannut perustietoihin, pääset aloittamaan varsinaisen kyselyn.</p><p>Kaikki vastaukset käsitellään luottamuksellisesti. Kukaan ei myöskään missään vaiheessa pääse näkemään vastauksiasi yksittäisiin väittämiin.</p>', 'fi', '2018-08-30 08:13:46.735543', '2018-10-08 11:24:47.455000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (218, 143, 'Mukautuvuus', 'fi', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (202, 157, '信任', 'zh', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (225, 157, 'Luottamus', 'fi', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (26, 160, 'Accountability', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (199, 160, '问责担当', 'zh', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
