INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (505, 1, '<h2>weCan 向您问好！</h2><p>我们在此邀请您填写一份有关您工作单位的问卷调查，请点击以下链接</p><p><a href="{{ surveyLink }}">weCan 问卷调查</a></p><p>问卷填写时间约需20分钟</p><p>此致,<br/>敬礼<br/>weCan</p>', 'zh', '2018-08-30 08:13:47.527770', '2018-08-30 08:13:47.527770', false);
