INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (301, 507, '<p>In the first phase you are asked to fill in practical details. After that you will find 50-70 statements concerning typical situations at work.</p><p>The viewpoints are yourself, your closest team and the entire organisation. If not mentioned otherwise in the statement, please use your team as the viewpoint.</p><p>It will take some 20 minutes to indicate your opinion to all statements. Don''t overthink the answers: the more spontaneously you answer, the more reliable the results will be. Reliable results require answers to all statements.</p><p>If possible, please do the survey in one go. Please note that no one will be able to see how you have answered to the individual statements.</p>', 'en', '2018-08-30 08:13:46.735543', '2019-06-05 05:02:55.672000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (335, 541, '<p>Please answer the statements below according to your opinion based on your experience. Usually the best answer is the first answer that comes into your mind. If you are not a member of any team, please use the entire organization as the viewpoint.</p>', 'en', '2018-08-30 08:13:46.735543', '2019-06-05 05:03:21.221000', false);
