INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (1038, 56, '<p>欢迎来到weCan的成长世界，祝贺您将看到新的发展潜力！</p><p>谢谢您和weCan一起踏上成功之旅。weCan方法包含五个步骤:</p><ul><li>问对问题</li><li>了解处境</li><li>关注重点</li><li>实现增长与成功</li><li>为持续增长而重复</li></ul><p>成功从看到自身发展潜力开始。首先是看到，其次是理解为什么和通过实践去实施如何做。</p><p>这份报告将就需要关注的方面、实操性行动以及可用方法给出详细建议。</p>', 'zh', '2018-11-20 13:28:47.596000', '2018-11-20 13:28:47.596000', false);
